- input: "TEXT\x1CC00316455\x1C.TEXT\x1C\x1CF3XA\x1CIn July, 2012, the PAC planned
    to raffle off a custom made tomahawk donated by one of the OGCA's members during
    July, 2012.  In its August 20, 2012 report, the PAC placed a value of $400 on
    the in-kind item.  It then included the $400 value in its receipts for the month
    of July.  It, however, also should have written off the value of the tomahawk
    via memo entry in order to avoid an overstatement of \"cash on hand.\"  This report
    shows the deletion of that non-existent $400 of cash. \n"
